import Header from "../../components/header";
import useClickOutside from "../../helper/clickOutside";

export default function Home() {
  useClickOutside();
  const el = useRef(null);
  return (
    <div>
      <Header />
      <div className="card" ref={el}></div>
    </div>
  );
}
